from typing import List
class Solution:
    def nearestValidPoint(self, x: int, y: int, points: List[List[int]]) -> int:
      print(points[6310], points[1048])
      smallest_y = min(filter(lambda p: p[0] == x, points), key=lambda p: abs(p[1] - y), default=None)
      smallest_x = min(filter(lambda p: p[1] == y, points), key=lambda p: abs(p[0] - x), default=None)
      if not smallest_x and not smallest_y:
        return -1
      if not smallest_y:
        return points.index(smallest_x)
      if not smallest_x:
        return points.index(smallest_y)
      if abs(smallest_x[0] - x) == abs(smallest_y[1] - y):
        return min(points.index(smallest_x), points.index(smallest_y))
      return points.index(min((smallest_x, smallest_y), key=lambda p: abs(p[0] - x) + abs(p[1] - y)))
         
